import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

function ImagesPage() {
  const [images, setImages] = useState([]);


  useEffect(() => {
    fetch("http://localhost:5000/images/view")
      .then((res) => res.json())
      .then((data) => {
        setImages(data.data);
      })
      .catch((error) => {
        console.log("Error fetching images:", error);
      });
  }, []);


  return (
    <div>
      <h1>Images Page</h1>
      {images.map((image,index) => (

        // <img
        //   key={index}
        //   alt="All Images"
        //   width={100}
        //   height={100}
        //   src={image.image}

        // />
        <Link
          key={index}
          to={`/images/edit/${image._id}`} // Pass the MongoDB ObjectID as a parameter
        >
          <img
            alt="All Images"
            width={100}
            height={100}
            src={image.image}
          />
        </Link>

      ))}
    </div>
  );
}

export default ImagesPage;
